    const [visible, setVisible] = useState(false)

    return(
        <li className="itensTech" key={e.id} onClick={() => {setVisible(true)}} >
            {/* {visible && <ModalEditarApagarTech apagarTech={apagarTech} id={e.id}/>} */}
              <img src={tec} alt="img" />
